import React, { Component } from 'react'

class Headline extends Component {
  /**
   * @brief     N/A
   * @remark    최근 자바스크맅트 클래스 내부 메소드는 function을 쓰지 않음
   * @returns   html code
   * function render() => render()
   */
  render() {
    return (
      <ul>
        <li>
          <a
            href="/create"
            onClick={function (e) {
              e.preventDefault()
              this.props.onChangeMode('create')
            }.bind(this)}
          >
            create
          </a>
        </li>
        <li>
          <a
            href="/update"
            onClick={function (e) {
              e.preventDefault()
              this.props.onChangeMode('update')
            }.bind(this)}
            // /update_process에 현재 contents의 id, title, desc를 넘겨줘야한다.
          >
            update
          </a>
        </li>
        <li>
          <input
            onClick={function (e) {
              e.preventDefault()
              this.props.onChangeMode('delete')
            }.bind(this)}
            type="button"
            value="delete"
          />
        </li>
      </ul>
    )
  }
}

export default Headline
